<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Title</title>
</head>
<body>
<script>
  function missingValue(a, b) {
    const result = [];
    for (let i = 0; i < b.length; i++) {
      if (!a.includes(b[i]) && !result.includes(b[i])) {
        result.push(b[i]);
      }
    }
    return result;
  }

  const a = [7, 2, 5, 3, 5, 3];
  const b = [7, 2, 5, 4, 6, 3, 5, 3];
  console.log(missingValue(a, b));
</script>
</body>
</html>
